import React, { useState } from 'react';
import {
    Button,
    Container,
    Paper,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    TextField,
    Typography
} from '@mui/material';

function AdminEmployeeAccess() {
    const [formData, setFormData] = useState({
        name: '',
        granted: false,
    });

    const [data, setData] = useState([
        // Здесь вы можете определить начальные данные для таблицы
    ]);

    const [editIndex, setEditIndex] = useState(null);

    const handleFormChange = (e) => {
        const { name, value, type, checked } = e.target;
        const newValue = type === 'checkbox' ? checked : value;
        setFormData({
            ...formData,
            [name]: newValue
        });
    };

    const handleAddRecord = () => {
        if (editIndex !== null) {
            // Обновляем данные редактируемой записи
            const newData = [...data];
            newData[editIndex] = formData;
            setData(newData);
            setEditIndex(null);
        } else {
            // Добавляем новую запись
            setData([...data, formData]);
        }
        setFormData({ name: '', granted: false });
    };

    const handleDeleteRecord = (index) => {
        const newData = [...data];
        newData.splice(index, 1);
        setData(newData);
    };

    const handleEditRecord = (index) => {
        // Заполняем форму данными выбранной записи для редактирования
        setFormData(data[index]);
        setEditIndex(index);
    };

    return (
        <Container>
            <Typography variant="h4" gutterBottom>
                Управление доступом сотрудников (администратор)
            </Typography>
            {/* Форма для добавления и редактирования записей */}
            <Paper elevation={3} style={{ padding: '20px', marginBottom: '20px' }}>
                <TextField
                    name="name"
                    label="Имя"
                    value={formData.name}
                    onChange={handleFormChange}
                    fullWidth
                    margin="normal"
                />
                <TextField
                    name="granted"
                    label="Доступ разрешен"
                    type="checkbox"
                    checked={formData.granted}
                    onChange={handleFormChange}
                    fullWidth
                    margin="normal"
                />
                <Button variant="contained" color="primary" onClick={handleAddRecord}>
                    {editIndex !== null ? 'Сохранить изменения' : 'Добавить запись'}
                </Button>
            </Paper>
            {/* Таблица для отображения данных */}
            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Номер</TableCell>
                            <TableCell>Имя</TableCell>
                            <TableCell>Доступ разрешен</TableCell>
                            <TableCell>Действия</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {data.map((row, index) => (
                            <TableRow key={index}>
                                <TableCell>{index + 1}</TableCell>
                                <TableCell>{row.name}</TableCell>
                                <TableCell>{row.granted ? 'Да' : 'Нет'}</TableCell>
                                <TableCell>
                                    <Button variant="contained" color="secondary" onClick={() => handleDeleteRecord(index)}>
                                        Удалить
                                    </Button>
                                    <Button variant="contained" color="primary" onClick={() => handleEditRecord(index)}>
                                        Редактировать
                                    </Button>
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </Container>
    );
}

export default AdminEmployeeAccess;
